import React from 'react'


const NavBar = () => {
  return (
    <div>
         <h1>Explore and travel</h1>
        <div>
                <button className='btnReloadEsp' onClick={handleOnClickReset}>Reset</button>
        </div>
        <br></br>
    </div>
  )
}

export default NavBar
